import React, { useEffect } from 'react';
import Slider from 'react-slick';
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';
import AOS from 'aos';
import 'aos/dist/aos.css';

const Carousel = () => {
  useEffect(() => {
    setTimeout(() => {
      AOS.refresh();
    }, 2000); // Adjust the delay as needed
  }, []);


  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
  };

  return (
    <Slider {...settings}>
      <div data-aos="fade-up" style={{height:"200px"}}>
       <h1>hey thisis my photo</h1>
